import React, { Component } from "react";
import axios from "axios";
import "./style/Home.css";
//import { Link } from "react-router-dom";

const server = "http://localhost:5000/api";

export default class Home extends Component {
  /* constructor(props) {
    super(props);

    this.state = {
      loginStats: false,
    };
  } */

  componentDidMount() {
    axios
      .get(`${server}/checkLogin`)
      .then((res) => {
        console.log(res.data);
        if (!res.data.login) {
          console.log("generate token");
          axios.post(`${server}/generateGuestToken`).then((res) => {
            console.log(res.data);
          });
        }
      })
      .catch((err) => console.log(err));
  }

  render() {
    return (
      <div>
        <div id="Welcome">
          <h3>Welcome</h3>
        </div>
        <div>
          <p>I'am Rizky Saputra</p>
        </div>
        <div>
          <p>
            A graduate from University of Lampung in BEng Electrical Engineering
            with specialization in Telecommunications and Information
            Technology.
          </p>
          <p>
            Someone with good learning ability, hard worker, and have good
            skills to think analytically
          </p>
        </div>
        <div>
          <h5>Skills</h5>
          <p>Javascript</p>
          <p>ReactJs</p>
          <p>Express</p>
          <p>MongoDB</p>
          <p>NodeJs</p>
          <p>Matlab</p>
          <p>Arduino</p>
        </div>
      </div>
    );
  }
}
